import React from 'react';
import { NavLink } from 'react-router-dom';
import './mobile-menu.css';

const MobileMenu = ({ navLinks }) => {
  return (
    <div className="mobile__menu">
      <ul className="menu__items">
        {navLinks.map((item, index) => (
        <li><span><i class="ri-home-7-fill"></i></span>
        <NavLink to="/home" activeClassName="active__link">
          Home
        </NavLink>
          </li>
        ))}
        <li><span><i class="ri-account-pin-circle-fill"></i></span>
          <NavLink to="/profile" activeClassName="active__link">
            Profile
          </NavLink>
        </li>
      </ul>
    </div>
  );
};

export default MobileMenu;
